import React from 'react'

export default function Sleepapp() {
    return (
        <div>
            <h1>Go to BED now</h1>
            <h3>Calculate the necessary sleep cycles if you lie down now</h3>
            <h3>Please click the below button</h3>
                <input type = "text"/>
                <button>Click to Calculate</button>
        </div>
    )
}
